import React from 'react';

const Output = ({ match }) => {
    const imag = match.params.imag;

    return (
      <div>
        {/* Display the image */}
        <img src={imag} style={{ width: '200px', height: '150px' }} />
      </div>
    );
  };

  export default Output;
